/* SYNTAX VARIABLES */
/* COLOR PALETTE */
/*
  OPEN COLOR 1.6.2
  by yeun
  github.com/yeun/open-color
*/
.github-RecentCommits {
  max-height: 97px;
  overflow-x: hidden;
  overflow-y: auto;
  border-top: 1px solid #363659;
}
.github-RecentCommits-list {
  margin: 0;
  padding: 6px 0;
  list-style: none;
}
.github-RecentCommits-message {
  padding: 6px 12px;
  text-align: center;
  color: #626274;
}
.github-RecentCommit {
  position: relative;
  display: flex;
  align-items: center;
  padding: 0 12px;
  line-height: 28px;
}
.github-RecentCommit-authors {
  position: absolute;
  display: flex;
}
.github-RecentCommit-avatar {
  position: relative;
  margin-right: -13px;
  width: 16px;
  height: 16px;
  border-radius: 4px;
  background-color: #3c3c52;
  box-shadow: 1px 0 #27273f;
  transition: margin 0.12s cubic-bezier(0.5, 0.1, 0, 1);
}
.github-RecentCommit-avatar:nth-child(1) {
  z-index: 3;
}
.github-RecentCommit-avatar:nth-child(2) {
  z-index: 2;
  opacity: .7;
}
.github-RecentCommit-avatar:nth-child(3) {
  z-index: 1;
  opacity: .4;
}
.github-RecentCommit-avatar:nth-child(n+4) {
  display: none;
}
.github-RecentCommit-avatar:only-child,
.github-RecentCommit-avatar:last-child {
  box-shadow: none;
}
.github-RecentCommit-authors:hover .github-RecentCommit-avatar {
  display: inline-block;
  margin-right: 1px;
  opacity: 1;
}
.github-RecentCommit-message {
  flex: 1;
  margin: 0 .5em;
  margin-left: 28px;
  text-overflow: ellipsis;
  white-space: nowrap;
  overflow: hidden;
}
.github-RecentCommit-undoButton.btn {
  padding: 0 8px;
  margin-right: 6px;
  height: 20px;
  line-height: 1;
  font-size: .9em;
}
.github-RecentCommit-time {
  color: #626274;
}
@media (min-height: 900px) {
  .github-RecentCommits {
    max-height: 153px;
  }
}
@media (min-height: 1200px) {
  .github-RecentCommits {
    max-height: 293px;
  }
}
